package flowExampleimport kotlinx.coroutines.flow.collectimport kotlinx.coroutines.flow.flowOfimport kotlinx.coroutines.runBlockingfun main() {    println("Start of Main thread")    runBlocking {        println("FLow is not executed yet")        sendNewNumbers().collect {            println("Received numnbers $it")        }        println("Finished Receiving numbers")    }    println("End of Main thread")}fun sendNewNumbers() = flowOf(1,2,3)